script: |
  super -f text -I q10805.spq | sort > q10805.out

inputs:
  - name: q10805.spq
    data: |
      SELECT DISTINCT - col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col1 NOT IN ( + + 3, col0 * + + col1, - ( + + 97 ), + col2, - col1 / 37 * - - col1 );
  - name: tab1

outputs:
  - name: q10805.out
    data: |
